package server

import (
	"encoding/base64"
	"encoding/json"
)

var (
	assetMap        map[string][]byte
	encodedUiAssets = ""
)

func decodeAssets() (map[string][]byte, error) {
	var m map[string][]byte
	b, err := base64.StdEncoding.DecodeString(encodedUiAssets)
	if err != nil {
		return nil, err
	}

	err = json.Unmarshal(b, &m)
	return m, err
}

func init() {
	m, err := decodeAssets()
	if err != nil {
		panic(err)
	}

	assetMap = m
}
